import React, { useContext } from 'react';
import ExpenseItem from './ExpenseItem';
import { AppContext
 } from '../context/AppContext';

function ExpenseList() {
    const expenses = [
        {id: 123455, name: "Lunch", cost: 50000},
        {id: 123456, name: "Dinner", cost: 50000},
        {id: 123457, name: "Coffee", cost: 200000},
        {id: 123458, name: "Skincare", cost: 500000},
        {id: 123459, name: "Wifi", cost: 250000},
    ];

    return (
        <ul className='list-group'>
            {expenses.map((expense) => (
                <ExpenseItem
                    id={expense.id}
                    name={expense.name}
                    cost={expense.cost} />
            ))}
        </ul>
    );
};

export default ExpenseList;
